import React, { Component } from 'react';
import { BrowserRouter } from 'react-router-dom';
import Header from './containers/Header';
import Login from './auth/Login';

class App extends Component {
  render(){
    return (
      <BrowserRouter>
        <div>
          <Header/>
          <Login/>
        </div>
      </BrowserRouter>
    )
  }
}

export default App;
